def flatten(seq,container=None):
    if container is None:
        container = []
    for s in seq:
        if hasattr(s,'__iter__'):
            flatten(s,container)
        else:
            container.append(s)
    return container

def tf_idf(document,texts):
	# texts.remove(document)
	set_document = list(set(document))
	tf_idf_scores = {}

	for word in set_document:
		tf = document.count(word)/len(document)

		num = 0
		for doc in texts:
			if word in doc:
				num += 1
		idf = math.log(len(texts)/num)
		tf_idf_scores[word] = tf*idf
	return tf_idf_scores

def freq_inv_freq(document, texts):
	set_document = list(set(document))
	fif_scores = {}
	total_words = sum([len(i) for i in texts])

	#if frequent in document and not in texts, score is high
	#if frequent in document and frequent in corpus, score is low

	print (document)
	print (set_document)
	for word in set_document:
		# print ('word', word)
		in_document_frequency = document.count(word)/len(document)
		corp_count = 0
		for doc in texts:
			for w in doc:
				if w == word:
					corp_count += 1
		score = in_document_frequency * (1/(corp_count/total_words))
		fif_scores[word] = score
	return fif_scores


def bigger_than(item,lst):
	# print (item)
	# print (lst)
	# print (type(item))
	# print (type(lst))
	num = 0
	for i in lst:
		if item > i:
			num += 1
	return num/len(lst)

